    <div className="shop-page" >        
        {console.log(props.match)}
        <Route exact path='/shop'element={<CollectionsOverview />} />
        <Route exact path='/shop'element={<CollectionsOverview />} />
        {/* <CollectionsOverview /> */}
    </div>
);

export default ShopPage;
